import React from "react";

import './app.css';
import Header from "../header";
import SideBar from "../side-bar";
import MainContent from "../main-content";
import Footer from "../footer";

const App = () => {
    return (
        <div className='app'>
            <Header />

            <div className='pink-block'></div>

            <div className='app__content'>
                <div>
                    <SideBar />
                </div>

                <div>
                    <MainContent />
                </div>

            </div>

            <Footer />
        </div>
    )
};

export default App;
